# https://leetcode.com/problems/is-subsequence/description/


class Solution(object):
    def isSubsequence(self, s, t):
        """
        :type s: str
        :type t: str
        :rtype: bool
        """

        n_s = len(s)
        n_t = len(t)
        i = j = 0

        if n_s == 0:
            return True

        while i < n_s and j < n_t:
            if s[i] == t[j]:
                if i == n_s - 1:
                    return True
                i += 1
            j += 1

        return False


print(Solution().isSubsequence("abc", "ahbgdc"))
print(
    Solution().isSubsequence(
        "bcd",
        "",
    )
)
